content:
Başkent Üniversitesi Psikoloji Bölümüne (
@pskbaskent
) bağlı #KlinikPsikoloji yüksek lisans programı öğrencisi Ece Gözde Ergür, 16 Ağustos 2021 günü tezini savunacaktır. 

#psikoloji #klinikpsikoloji #depresyon #erteleme #benlikalgısı #zamanalgısı #bilişselçarpıtma

#Depresyon ve #anksiyete bir arada olduğunda hem korkak hem yorgunsundur;

     Başaramamaktan korkarsın ama üretmeye gücün yoktur.

     Yalnız kalmaktan korkarsın ama başkalarıyla olma isteğin yoktur.
